    public static String removeDuplicates(String s) {
        for(int i=0;i<s.length();i++){
            char[] c = s.toCharArray();
            if(i==0) continue;
            if(c[i] == c[i-1]) {
                s = s.substring(0,i-1)+s.substring(i+1,s.length());
                i -= 2;
            }
        }
        return s;
    }
